import { BrowserRouter, Route, Routes } from "react-router-dom";
import { Login } from "../components/pages/Login";
import { Home } from "../components/pages/Home";
import { EmployeeInfoList } from "../components/pages/EmployeeInfoList";
import { EmployeeResister } from "../components/pages/EmployeeResister";
import { Setting } from "../components/pages/Setting";
import { EditProfile } from "../components/pages/EditProfile";
import { EditPassword } from "../components/pages/EditPassword";
import { Page404 } from "../components/pages/Page404";
import { FC, memo } from "react";
import { useRecoilState } from "recoil";
import { AuthProvider } from "../contexts/AuthProvider";

export const Router: FC = memo(() => {
  const [authProvider, setAuthProvider] = useRecoilState(AuthProvider);
  return (
    <BrowserRouter>
      <Routes>
        <Route index element={<Login />}></Route>
        <Route
          path="/home"
          element={authProvider ? <Home /> : <Page404 />}
        ></Route>
        <Route
          path="/home/employeeInfoList"
          element={authProvider ? <EmployeeInfoList /> : <Page404 />}
        ></Route>
        <Route
          path="/home/resister"
          element={authProvider ? <EmployeeResister /> : <Page404 />}
        />
        <Route
          path="/home/setting"
          element={authProvider ? <Setting /> : <Page404 />}
        />
        <Route
          path="/home/setting/editProfile"
          element={authProvider ? <EditProfile /> : <Page404 />}
        />
        <Route
          path="/home/setting/editPassword"
          element={authProvider ? <EditPassword /> : <Page404 />}
        />
        <Route path="*" element={<Page404 />}></Route>
      </Routes>
    </BrowserRouter>
  );
});
